import React from 'react';
import styles from '../styles/home.module.scss';
import 'antd/dist/antd.css';
import {Link} from "react-router-dom";

export default class Home extends React.Component {

    render() {
        return (
            <div className={styles.container}>
                <img className={styles.logo_home} src={require('../images/logo_home.png')}/>
                <div className={styles.app_name}>松鼠加速器</div>
                <div className={styles.mining_title}>挖矿111网赚联盟</div>
                <div className={styles.mining_desc}>
                    邀请好友购买套餐，<br/>
                    顶级加速器即可免费用！<br/>
                    邀请越多，赚得越多！<br/>
                    2019，邀您共同躺着赚钱！<br/>
                </div>
                <Link to="/login"><button className={styles.btn_start}>开始体验</button></Link>
                <Link to="/login"><div className={styles.link_more}>了解详情</div></Link>
            </div>
        );
    }

}
